package com.ahyar.diramut;

import android.content.ContentValues;
import android.content.Context;
import android.database.sqlite.SQLiteDatabase;
import android.database.sqlite.SQLiteOpenHelper;

public class DataHelper extends SQLiteOpenHelper {

    public static final String DB_NAME = "contacts.db";
    public static final String TABLE_NAME = "CONTACTS";
    public static final int DB_VERSION = 3;

    public static final String COLUMN_1 = "ID";
    public static final String COLUMN_2 = "NMPENYAKIT";
    public static final String COLUMN_3 = "DESKRIPSI";
    public static final String COLUMN_4 = "GEJALA";
    public static final String COLUMN_5 = "SOLUSI";
    public static final String COLUMN_6 = "IMAGE";
    public static final String QUERY_CREATE = "CREATE TABLE "+TABLE_NAME+" ("
            +COLUMN_1+" INTEGER PRIMARY KEY AUTOINCREMENT, "
            +COLUMN_2+" TEXT, "
            +COLUMN_3+" TEXT, "
            +COLUMN_4+" TEXT, "
            +COLUMN_5+" TEXT, "
            +COLUMN_6+" TEXT)";




    public DataHelper(Context context, String name, SQLiteDatabase.CursorFactory factory, int version) {
        super(context, DB_NAME, null, DB_VERSION);
    }

    @Override
    public void onCreate(SQLiteDatabase db) {
        db.execSQL(QUERY_CREATE);
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Cacingan','Kucing terinfeksi oleh cacing internal atau parasit dalam saluran pencernaan mereka. Cacing pada kucing dapat berasal dari berbagai jenis cacing, termasuk cacing gilik (Toxocara cati), cacing tambang (Ancylostoma tubaeforme), dan cacing pita (Dipylidium caninum).','1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tSering bab lebih dari 8x sehari\n" +
                "4.\tBau bab lebih tajam dengan darah\n" +
                "5.\tPenurunan berat badan\n" +
                "6.\tGatal sekitar Anus\n" +
                "7.\tMuntah lebih dari 5x sehari\n" +
                "8.\tMuntah disertai cacing\n" +
                "9.\tBulu kusam\n','Kalau masih aktif bisa dikasih obat cacing, tetapi apabila lemas dianjurkan dibawa keklinik','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Jamuran','Jamur pada kucing dapat disebabkan oleh berbagai jenis jamur, seperti Microsporum canis, Trichophyton mentagrophytes, dan Malassezia pachydermatis. Jamur poda pada kucing adalah jenis infeksi jamur yang disebabkan oleh Malassezia pachydermatis. Jamur poda pada kucing dapat menyebabkan infeksi kulit dan telinga,','" +
                "1.\tKebotakan disertai ketombe\n" +
                "2.\tLuka-luka pada kulit tidak simetris dan berbntuk bulat\n" +
                "3.\tJarang mandi\n','" +
                "Mandi anti jamur, dan minum obat anti jamur (Dibawah pengawasan dokter)','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Kutuan','Kutuan pada kucing disebabkan oleh serangan kutu yang hidup di bulu kucing. Kutu pada kucing dapat membawa telur cacing pita yang dapat menimbulkan infeksi cacing pada kucing.','" +
                "1.\tBulu Kusam\n" +
                "2.\tBulu sering rontok\n" +
                "3.\tLuka-luka didareah tengkuk, leher dan kepala\n" +
                "4.\tKulit kemerahan\n" +
                "3.\tLuka-luka didareah tengkuk, leher dan kepala\n','" +
                "Tetes kutu, flea control, dan groming','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Gangguan Liver','Gangguan hati atau liver pada kucing dapat disebabkan oleh berbagai faktor, seperti keracunan, infeksi, dan penyakit hati seperti lipidosis hati atau hati berlemak. ','" +
                "1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tMuntah pakan\n" +
                "4.\tMuntah diwaktu tertentu\n" +
                "5.\tMuntah berwarna kuning, berbusa, dan lender putih\n" +
                "6.\tPenurunan berat badan\n','Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Virus rhinotracheitis','Virus rhinotracheitis pada kucing adalah infeksi saluran pernapasan atau paru-paru yang disebabkan oleh Felid alphaherpesvirus 1 (FeHV-1) dari keluarga Herpesviridae. ','" +
                "1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tDemam\n" +
                "4.\tVaksin tidak komplit atau belum pernah vaksin\n" +
                "5.\tPilek\n" +
                "6.\tSering bersin / bersin diwaktu tertentu\n','" +
                "Apabila Flu dan masih nafsu makan bisa rawat jalan','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Virus calisi','Virus calici pada kucing atau feline calicivirus adalah patogen virus yang menyebabkan infeksi saluran pernapasan atas pada kucing. Virus ini biasanya menyerupai flu dan dapat menyerang sistem pernapasan, mulut, dan persendian kucing. Virus calici pada kucing dapat menyebar melalui sekresi hidung, mulut, dan mata, serta melalui kontak dengan objek yang telah terkontaminasi.','" +
                "1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tDemam\n" +
                "4.\tSering bersin / bersin diwaktu tertentu\n" +
                "5.\tSariwan\n" +
                "6.\tSering keluar air liur\n" +
                "7.\tBau mulut tajam\n" +
                "8.\tLumpuh tiba-tiba\n','" +
                "Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Virus panleukopenia','Virus panleukopenia pada kucing atau Feline Panleukopenia Virus (FPV) adalah penyakit virus yang sangat menular dan berpotensi fatal yang menyerang kucing. Virus ini disebabkan oleh feline parvovirus (FPV) dan biasanya menyerang anak kucing serta kucing yang belum divaksin. Virus ini dapat menginfeksi dan merusak organ tubuh kucing, seperti sumsum tulang, usus, dan kulit. Virus panleukopenia juga bisa menyerang janin kucing pada kucing yang hamil. Virus panleukopenia dapat hidup lama dan ditemukan di berbagai tempat, misalnya mangkuk makan kucing, kotak pasir, kandang, tempat bermain, dan tempat tidurnya.','" +
                "1.\tMuntah lebih dari 5x sehari\n" +
                "2.\tTidak nafsu makan\n" +
                "3.\tInfeksi telinga\n" +
                "4.\tLesu\n" +
                "5.\tDiare berdarah\n" +
                "6.\tPucat\n','" +
                "Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','')");

        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Chlamydia','Penyakit yang disebabkan oleh bakteri Chlamydophila felis, sebelumnya dikenal sebagai Chlamydia psittaci. Ini bukanlah infeksi seksual seperti chlamydia pada manusia; sebaliknya, itu adalah penyakit yang menyerang sistem pernapasan dan mata pada kucing.','" +
                "1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tDemam\n" +
                "4.\tSering bersin / bersin diwaktu tertentu\n" +
                "5.\tMata belekan\n','" +
                "Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','" +
                "')");

        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Infeksi Bakteri Pernafasan','Kelompok penyakit pernapasan yang disebabkan oleh berbagai jenis bakteri yang menginfeksi saluran pernapasan atas atau bawah kucing. Bakteri yang umumnya terlibat dalam infeksi ini mencakup Chlamydophila felis, Bordetella bronchiseptica, Mycoplasma spp., Pasteurella multocida, dan lainnya.','" +
                "1.\tTidak nafsu makan\n" +
                "2.\tBatuk-batuk\n" +
                "3.\tPilek\n" +
                "4.\tDemam\n" +
                "5.\tSesak Nafas\n','" +
                "Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','" +
                "')");

        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('FIP','FIP (Feline Infectious Peritonitis) pada kucing adalah penyakit yang disebabkan oleh coronavirus feline (FCoV). Ini adalah penyakit yang serius dan biasanya fatal pada kucing. FCoV sendiri adalah virus yang umum di antara kucing, dan sebagian besar kucing yang terinfeksi FCoV tidak menunjukkan gejala yang serius.','" +
                "1.\tTidak nafsu makan\n" +
                "2.\tBatuk-batuk\n" +
                "3.\tCepat lelah\n" +
                "4.\tLemas\n" +
                "5.\tSesak Nafas\n" +
                "6.\tMencret\n" +
                "7.\tLumpuh tiba-tiba\n','" +
                "Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','" +
                "')");

        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Protozoa Pencernaan','Protozoa pencernaan pada kucing adalah mikroorganisme uniseluler yang dapat ditemukan di saluran pencernaan kucing. Ini mencakup berbagai jenis protozoa seperti Giardia, Coccidia, dan Trichomonas foetus.','" +
                "1. Kembung\n" +
                "2. Mencret\n" +
                "3. Mencret disertai darah\n" +
                "4. Muntah lebih dari 5x sehari\n" +
                "5. Tidak pernah dikasih anti parasit\n" +
                "6. Tempat pop kurang bersih\n','" +
                "Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','" +
                "')");

        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('FLUTD','FLUTD (Feline Lower Urinary Tract Disease) adalah kondisi umum yang memengaruhi saluran kemih bawah pada kucing. Kondisi ini dapat mencakup sejumlah masalah, termasuk peradangan pada dinding kandung kemih, pembentukan batu kandung kemih, iritasi kemih, atau peradangan uretra.','" +
                "1. Tidak kencing seharian\n" +
                "2. Kencing sedikit sedikit\n" +
                "3. Kencing berdarah\n" +
                "4. Muntah berwarna kuning, berbusa, dan lendir putih\n" +
                "5. Tidak nafsu makan\n" +
                "6. Lemas\n" +
                "7. Gelisah\n" +
                "8. Sesak Nafas\n','" +
                "Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','" +
                "')");

        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Keracunan','Keracunan kucing merujuk pada kondisi di mana kucing mengonsumsi zat atau bahan yang beracun dan dapat mengakibatkan efek negatif pada kesehatan mereka.','" +
                "1. Muntah mendadak\n" +
                "2. Sesak Nafas\n" +
                "3. Mata melotot\n" +
                "4. Mulut berbusa\n" +
                "5. Suka bersembunyi\n" +
                "6. Kencing berdarah\n" +
                "7. Mengeong kencang\n','" +
                "Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','" +
                "')");

    }



    @Override
    public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
        db.execSQL("DROP TABLE IF EXISTS "+TABLE_NAME);
        onCreate(db);
    }


    public void insertData(ContentValues values){
        getWritableDatabase().insert(TABLE_NAME, null, values);
    }


}